window.bookSummaryJSON = "<p><b>Lina remembers everything.</b></p> <p>Armed with Nord and her reawakened powers, Lina will not rest until she finds the man responsible for her murder. However, rediscovering her complicated history with the man who killed her also reveals something much darker.</p> <p>Lina is one of the heirs to the notorious criminal order, the Mobius Council, an organization that the Brotherhood has been seeking to destroy for decades.</p> <p>Hunted by her murderer, wanted by the Brotherhood, and struggling to relearn her powers, Lina will need to put everything on the line to reclaim her life. Failure isn't an option. Because losing means forfeiting the one thing she holds above everything else. Nord.</p> <p><b>This is the second book in the Undercover Magic series, picking up where </b><b><i>Hint of Danger</i></b><b> leaves off.</b></p> <p><b>Recommended for ages 18 and older due to adult language, content, and scenes with graphic violence.</b></p>"; 
